import logo from './logo.svg';
import './App.css';
import Card from './components/Card';
import NavBar from './components/NavBar';
import data from './data';
import imgStar from './images/Star.png'
import FooterSec from './components/FooterSec';
import {Route, Routes } from 'rea';
import Deserts from './components/Deserts';

function App() {
  const menuArr = data.map(dish =>{
    return <Card
    key={dish.id}
    img={imgStar}
    {...dish}/>
  })

  return (
    <div className="App">
      <NavBar img='https://coffeeboom.kz/themes/coffeeboom/src/build/images/logo.svg'/>
      <Routes>
          <Route path='deserts/' element={<Deserts />} />
          {/* <Route path='profile/:userId' element={<ProfileContainer />} />
          <Route path='users' element={<UsersContainer />} />
          <Route path='/news' element={<News />} /> 
          <Route path='/pleasure' element={<Pleasure />} />
          <Route path='/doNotTouch' element={<DoNotTouch />} /> */}
        </Routes> 
      <section className='cards-list'>
        {menuArr}
      </section>
      <FooterSec />
    </div>
  );
}

export default App;
